void
sbG2P3FePpCamState_Init(sbG2P3FePpCamState_t *pCam) {
    pCam->customer =  (unsigned int) 0;
    pCam->provider =  (unsigned int) 0;
    pCam->oamloop =  (unsigned int) 0;
    pCam->tpid =  (unsigned int) 0;
    pCam->twintpid =  (unsigned int) 0;
    pCam->pbb =  (unsigned int) 0;
    pCam->ipv4mc =  (unsigned int) 0;
    pCam->lsmmatch =  (unsigned int) 0;
    pCam->uState =  (unsigned int) 0;
    pCam->portid =  (unsigned int) 0;
}

sbStatus_t
sbG2P3FePpCamStateCode_Decode(
    sbG2P3FePpCamState_t *pCamStateData,
    sbG2P3FePpCamState_t *pCamStateMask,
    sbG2P3FePpCamStateCode_t camStateCode
) {
    switch (camStateCode) {
    case SB_G2P3_FE_PP_CAM_STATE_CODE_CT:
       pCamStateData->customer = 1;
       pCamStateMask->customer = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_STATE_CODE_PT0:
       pCamStateData->provider = 1;
       pCamStateMask->provider = 0x1;
       pCamStateData->tpid = 0;
       pCamStateMask->tpid = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_STATE_CODE_PT1:
       pCamStateData->provider = 1;
       pCamStateMask->provider = 0x1;
       pCamStateData->tpid = 1;
       pCamStateMask->tpid = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_STATE_CODE_OL:
       pCamStateData->oamloop = 1;
       pCamStateMask->oamloop = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_STATE_CODE_TT:
       pCamStateData->provider = 1;
       pCamStateMask->provider = 0x1;
       pCamStateData->twintpid = 1;
       pCamStateMask->twintpid = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_STATE_CODE_PBB:
       pCamStateData->pbb = 1;
       pCamStateMask->pbb = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_STATE_CODE_V4MC:
       pCamStateData->pbb = 1;
       pCamStateMask->pbb = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_STATE_CODE_LSM:
       pCamStateData->lsmmatch = 1;
       pCamStateMask->lsmmatch = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_STATE_CODE_NON_LSM:
       pCamStateData->lsmmatch = 0;
       pCamStateMask->lsmmatch = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_STATE_CODE_DONT_CARE:
        /* Do Nothing */
    break;
    default:
        return SOC_E_PARAM;
    }
    return SOC_E_NONE;
}

sbStatus_t
sbG2P3FePpCamUpdateCode_Decode(
    sbG2P3FePpCamState_t *pRamStateData,
    sbG2P3FePpCamState_t *pRamStateMask,
    sbG2P3FePpCamUpdateCode_t camUpdateCode
) {
    switch (camUpdateCode) {
    case SB_G2P3_FE_PP_CAM_UPDATE_CODE_LSM:
       pRamStateData->lsmmatch = 1;
       pRamStateMask->lsmmatch = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_UPDATE_CODE_NON_LSM:
       pRamStateData->lsmmatch = 0;
       pRamStateMask->lsmmatch = 0x1;
    break;
    case SB_G2P3_FE_PP_CAM_UPDATE_CODE_NO_CHANGE:
        /* Do Nothing */
    break;
    default:
        return SOC_E_PARAM;
    }
    return SOC_E_NONE;
}

